import { Route, Switch} from "react-router-dom";

import Welcome from "./components/pages/Welcome";

function App() {
  return (
    <div>

      <Route path="/" exact></Route>
      <Route path="/welcome">
        <Welcome />
      </Route>
    </div>
  );
}

export default App;
